e logged in\n    \n    Examples:\n    |    username       |      password    |\n    |   hellohello      |     secret_sauce |\n    |   standard_user   |     hjkhsdhgffsv |\n    |                   |     secret_sauce |\n    |   standard_user   |                  |\n    |                   |                  |\n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    # different format of defining the scenario as a user\n       #Scenario: As a user, I should be able to login with valid cred\n         # Given I am on the login page\n         # When I enter a valid username and valid password\n         # And I click on the signin button\n         # Then I am logged in successfully\n         \n         \n         \n         \n         ","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/primetech/Documents/Eclipse/Batch6_workspace/FirstMavenProject/src/test/resources/features/sauceDemo.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@regression","id":"113df364-e784-4bdc-b887-1ac9a13e7976"},{"location":{"line":1,"column":13},"name":"@login_tests","id":"51b6323c-3d28-45a4-892b-35b93c78b44e"}],"language":"en","keyword":"Feature","name":"Sauce Demo Functionalities","description":"         This is to automate sauce demo functionalities","children":[{"background":{"location":{"line":13,"column":3},"keyword":"Background","name":"","description":"","steps":[{"location":{"line":14,"column":3},"keyword":"Given ","keywordType":"Context","text":"user is on the login page","id":"889e771b-78ba-49d2-9757-1735b879d2b7"}],"id":"51434951-118f-434d-9f97-189724a4e82d"}},{"scenario":{"location":{"line":19,"column":3},"tags":[{"location":{"line":18,"column":3},"name":"@smoke_tests","id":"2541940d-b004-49ad-8078-ebd0b158d122"},{"location":{"line":18,"column":16},"name":"@valid_login","id":"4acb6f78-ff7f-41da-a618-5fbe800a53d2"},{"location":{"line":18,"colum
